import React from 'react';

const CartItem = ({ product, removeFromCart }) => {
  const { id, image, name, price } = product;

  return (
    <div>
      <img src={image} alt={name} />
      <h2>{name}</h2>
      <p>${price}</p>
      <button onClick={() => removeFromCart(product)}>Remove</button>
    </div>
  );
};

export default CartItem;
